import React from 'react';

function AboutMe() {
    return (
        <div className="aboutMeConteiner">
            <article id="aboutMe">
                Olá, <br/>
                Meu nome é Robertson Maxwel.<br/>
                Eu sou Desenvolvedor Full Stack.<br/>
                Gosto de criar coisas que surpreendem e encantam!<br/>
            </article>
        </div>
    );
};

export default AboutMe;
